script: |
  super -f text -I q7646.spq | sort > q7646.out

inputs:
  - name: q7646.spq
    data: |
      SELECT - + col0 * - + col1 * col1 + 82 * CAST ( + col1 AS REAL ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 + - col0 + - col0 + + - col2 * 5 NOT BETWEEN + 77 AND - col2;
  - name: tab1

outputs:
  - name: q7646.out
    data: |
